import React from 'react';
import styled from 'styled-components';
import { Link } from 'react-scroll';

const LogoContainer = styled(Link)`
  display: flex;
  align-items: center;
  gap: 0.5rem;
  cursor: pointer;
`;

const LogoIcon = styled.div`
  svg {
    width: 32px;
    height: 40px;
    overflow: visible;
  }
`;

const LogoText = styled.span`
  font-family: var(--font-heading);
  font-weight: 700;
  font-size: 1.5rem;
  color: var(--color-text);
`;

const Logo = () => {
  return (
    <LogoContainer to="hero" smooth={true} duration={500}>
      <LogoIcon>
        <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 40 40" width="32" height="32" fill="none">
          {/* Heart base */}
          <path
            d="M20 36C20 36 34 27 34 17C34 11 29 7 24 7C21.5 7 19.4 8.2 18 10C16.6 8.2 14.5 7 12 7C7 7 2 11 2 17C2 27 16 36 20 36Z"
            stroke="#FF6B35"
            strokeWidth="2"
            strokeLinecap="round"
            strokeLinejoin="round"
          />
          {/* Stethoscope head */}
          <circle 
            cx="32" 
            cy="28" 
            r="3" 
            stroke="#FF6B35" 
            strokeWidth="2"
          />
          {/* Stethoscope tube */}
          <path
            d="M32 31L32 36"
            stroke="#FF6B35"
            strokeWidth="2"
            strokeLinecap="round"
          />
          {/* Stethoscope connection to heart */}
          <path
            d="M32 28C32 28 32 24 30 20"
            stroke="#FF6B35"
            strokeWidth="2"
            strokeLinecap="round"
          />
        </svg>
      </LogoIcon>
      <LogoText>HomeNurse</LogoText>
    </LogoContainer>
  );
};

export default Logo;
